<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>ACE BRAND AGENCY | MANIFESTO</title>
    <style>
        /* === ШРИФТОВАЯ МАГИЯ (НЕРУШИМА) === */
        @font-face {
            font-family: 'Brahms Gotisch';
            src: url('../fonts/BrahmsGotischCyr.woff2') format('woff2');
            font-weight: normal; font-style: normal; font-display: swap;
        }
        @font-face {
            font-family: 'Manufacturing Consent';
            src: url('../fonts/ManufacturingConsent-Regular.woff2') format('woff2');
            font-weight: normal; font-style: normal; font-display: swap;
        }
        @font-face {
            font-family: 'Unbounded';
            src: url('../fonts/Unbounded-ExtraLight.woff2') format('woff2');
            font-weight: 200; font-style: normal; font-display: swap;
        }

        /* === БАЗОВАЯ АРХИТЕКТУРА (ЕДИНАЯ) === */
        :root { 
            --abyss: #111111; 
            --quartz: #EFF0F4;
            --amethyst: #510FD5;
        }
        * { margin: 0; padding: 0; box-sizing: border-box; }
        html { scroll-behavior: smooth; }

        /* === ФОН ИЗ БЕЗДНЫ (СИНХРОНИЗИРОВАН) === */
        body {
            position: relative;
            background-image: url('../assets/back.png');
            background-size: cover;
            background-position: center;
            background-attachment: fixed;
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            padding: 50px 5vw;
            overflow-y: auto;
        }

        body::before {
            content: '';
            position: fixed;
            top: 0; left: 0;
            width: 100%; height: 100%;
            background-color: rgba(17, 17, 17, 0.7); /* Вуаль тьмы 70% */
            z-index: 0;
        }

        /* === КОНТЕЙНЕР ДЛЯ АРТЕФАКТА === */
        .grimoire-wrapper {
            position: relative;
            width: 100%;
            max-width: 950px; /* Размер "Имперского" фрейма, чтобы SVG идеально вписался */
            z-index: 1;
            animation: fadeInArtifact 1.5s ease-out forwards;
        }
        @keyframes fadeInArtifact {
            from { opacity: 0; transform: scale(0.98); }
            to { opacity: 1; transform: scale(1); }
        }

        /* === МЕСТО ДЛЯ МАНИФЕСТА (SVG) === */
        .manifesto-svg-container {
            display: none; /* Скрыто по умолчанию */
        }
        .manifesto-svg-container.active {
            display: block; /* Показываем нужный язык */
        }
        .manifesto-svg-container svg {
            width: 100%;
            height: auto;
            display: block;
        }

        /* === МЕСТО ДЛЯ ПЕЧАТИ (SVG) === */
        .seal-container { 
            position: absolute; 
            bottom: 10%; /* Положение может потребовать калибровки в зависимости от финального SVG */
            right: 15%;
            width: 150px; 
            height: 150px; 
            z-index: 3; 
        }

        .seal-button-svg {
            display: none;
            width: 100%;
            height: 100%;
            cursor: crosshair;
            animation: pulse 2.5s infinite ease-in-out;
        }
        .seal-button-svg.active {
            display: block;
        }
        .seal-button-svg svg {
            width: 100%;
            height: 100%;
            transition: transform 0.4s ease;
        }
        .seal-button-svg:hover svg {
            transform: scale(1.08);
        }
        @keyframes pulse {
            0% { transform: scale(1); }
            50% { transform: scale(1.05); }
            100% { transform: scale(1); }
        }

        /* === МОБИЛЬНАЯ АДАПТАЦИЯ === */
        @media (max-width: 768px) {
            body {
                background-image: url('../assets/back_m.png');
                background-attachment: scroll;
            }
            .seal-container {
                width: 90px;
                height: 90px;
                bottom: 5%;
                right: 8%;
            }
        }
    </style>
</head>

                document.getElementById('ru-seal-btn').classList.add('active');
            } else {
                document.getElementById('en-manifesto').classList.add('active');
                document.getElementById('en-seal-btn').classList.add('active');
            }

            // УСТАНАВЛИВАЕМ ПУТЬ ДЛЯ ОБЕИХ ПЕЧАТЕЙ
            const nextPageLink = `../initiation/?lang=${lang}`;
            document.getElementById('ru-seal-btn').href = nextPageLink;
            document.getElementById('en-seal-btn').href = nextPageLink;

            // ЗАКЛИНАНИЕ АНИМАЦИИ (ПЕРВОРОДНЫЙ ШТОРМ)
            if (!window.isUnifiedAnimationInitialized) {
                (function() {
                    const canvas = document.getElementById('global-ash-canvas');
                    if (!canvas) return;
                    const ctx = canvas.getContext('2d');
                    function resizeCanvas() { canvas.width = window.innerWidth; canvas.height = window.innerHeight; }
                    resizeCanvas(); window.addEventListener('resize', resizeCanvas);
                    let particles = []; let fogTime = 0;
                    class AshParticle {
                        constructor(x, y) { this.x = x; this.y = y; this.vx = (Math.random() - 0.5) * 0.8; this.vy = -Math.random() * 0.5 - 0.2; this.life = 1; this.decay = 0.008 + Math.random() * 0.012; this.size = Math.random() * 3 + 1; this.color = Math.random() > 0.8 ? '#510FD5' : '#C1BFBF'; }
                        update() { this.x += this.vx; this.y += this.vy; this.vx *= 0.98; this.vy += 0.01; this.life -= this.decay; this.size *= 0.998; }
                        draw() { ctx.save(); ctx.globalAlpha = this.life * 0.8; ctx.fillStyle = this.color; ctx.beginPath(); ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2); ctx.fill(); ctx.restore(); }
                    }
                    function drawFog() {
                        const fogHeight = 120;
                        const gradient = ctx.createLinearGradient(0, canvas.height, 0, canvas.height - fogHeight);
                        gradient.addColorStop(0, `rgba(17, 17, 17, ${0.4 + Math.sin(fogTime) * 0.1})`);
                        gradient.addColorStop(0.5, `rgba(17, 17, 17, 0.2)`);
                        gradient.addColorStop(1, `rgba(17, 17, 17, 0)`);
                        ctx.fillStyle = gradient; ctx.fillRect(0, canvas.height - fogHeight, canvas.width, fogHeight);
                        fogTime += 0.005;
                    }
                    function handleMouseMove(e) { for (let i = 0; i < 6; i++) { particles.push(new AshParticle(e.clientX + (Math.random() - 0.5) * 30, e.clientY + (Math.random() - 0.5) * 30)); } }
                    function handleTouchMove(e) { if (e.touches[0]) { handleMouseMove({ clientX: e.touches[0].clientX, clientY: e.touches[0].clientY }); } }
                    function animate() {
                        ctx.clearRect(0, 0, canvas.width, canvas.height); drawFog();
                        particles = particles.filter(p => { p.update(); p.draw(); return p.life > 0 && p.size > 0.1; });
                        if (Math.random() < 0.03) { particles.push(new AshParticle(Math.random() * canvas.width, canvas.height + 10)); }
                        requestAnimationFrame(animate);
                    }
                    window.addEventListener('mousemove', handleMouseMove, { passive: true });
                    window.addEventListener('touchmove', handleTouchMove, { passive: true });
                    animate(); window.isUnifiedAnimationInitialized = true;
                })();
            }

            // ЗАКЛИНАНИЕ ЗАЩИТЫ
            if (!window.isContentProtectionInitialized) {
                (function() {
                    document.addEventListener('contextmenu', e => e.preventDefault(), false);
                    document.addEventListener('keydown', e => { if ((e.ctrlKey || e.metaKey) && ('caxu'.indexOf(e.key) !== -1)) { e.preventDefault(); } });
                    window.isContentProtectionInitialized = true;
                })();
            }
        });
    </script>
</body>
</html>
